import {BrowserRouter , Route,Switch} from 'react-router-dom' ;

import Footer from '../components/Footer' ;


class App extends Component {
  constructor(){
    super();
    this.state={};
  }


  render(){
    return (
      <div className="App">
        <BrowserRouter>

          <Nav2/>

        </BrowserRouter>
        <Footer />
        <input id="baseUrl" hidden defaultValue='https://class-take-attendance.herokuapp.com' />
      </div>
    );
  }
}
export default App;
